import './contact.css';
import { LinkedinOutlined, GithubOutlined, MailOutlined } from '@ant-design/icons';

function Contact() {
  const copyToClipboard = (text) => {
    navigator.clipboard.writeText(text).then(() => {
        alert('Email copié dans le presse-papiers !');
    }).catch((err) => {
        console.error('Erreur lors de la copie dans le presse-papiers : ', err);
    });
};

    return (
        <section id="contact">
          <h2>Contact :</h2>
          <ul>
          <a href="https://www.linkedin.com/in/ayoub-b-569602273" target="_blank" rel="noopener noreferrer">
              <li>
                <LinkedinOutlined style={{ fontSize: '24px', marginRight: '8px' }} />
                LinkedIn
              </li>
            </a>
            <li>
              <a href="https://github.com/Sneax0709" target="_blank" rel="noopener noreferrer">
                <GithubOutlined style={{ fontSize: '24px', marginRight: '8px' }} />
                GitHub
              </a>
            </li>
            <li>
              <div onClick={() => copyToClipboard('ayoub.bendareur@epitech.eu')} style={{ cursor: 'pointer', display: 'inline-flex', alignItems: 'center' }}>
                <MailOutlined style={{ fontSize: '24px', marginRight: '8px' }} />
                Mail
              </div>
            </li>
          </ul>
        </section>
    );
}

export default Contact;
